import React from 'react'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { Link, useParams } from 'react-router-dom'
export const ChatUserRender = (object) => {
    const link = `/message/dm/${object.object._id}`;
    return(
        <Link to={link} className="w-100 m-0 p-0 row dotText text-light" style={{height:'50px', textDecoration:'none'}}>
            <div className="col-3 m-auto p-0 center">
                <FontAwesomeIcon icon="fa-solid fa-user" />
            </div>
            <div className="col-9 text-start p-0 m-auto fs-5 pr-2">
                {object.object.name}
            </div>
        </Link>
    )
}
export const GroupUserRender = (object) => {
    const link = `/message/g/${object.object._id}`;
    return(
        <Link to={link} className="w-100 m-0 p-0 row dotText text-light" style={{height:'50px', textDecoration:'none'}}>
            <div className="col-3 m-auto p-0 center">
                <FontAwesomeIcon icon="fa-solid fa-user" />
            </div>
            <div className="col-8 text-start p-0 m-auto fs-5">
                {object.object.name}
            </div>
        </Link>
    )
}
export const ChatDMRender = (Objects) => {
    let { id } = useParams();
    //const socket = io("ws://localhost:5000")
    const name = Objects.Object.find(account => account._id === id).name
    return(
        <div className="w-100 h-100 m-0 p-0 text-light">
            <div className="w-100 center m-0 p-0" style={{height:'15%',boxShadow:'0px 5px 5px #000316'}}>
                <div className="w-75 text-start">
                    <FontAwesomeIcon icon="fa-solid fa-user" />
                    &nbsp; <b>{name}</b>
                </div>
            </div>
            <div className="w-100 center m-0 p-0" style={{height:'70%'}}>
                <div className="w-75 text-start">
                    
                </div>
            </div>
            <div className="w-100 center m-0 p-0" style={{height:'15%'}}>
                <div className="text-start" style={{width:'95%'}}>
                    <input className="p-1 fw-bold rounded" style={{width:'85%',background:'none', border:'0.5px solid white'}}/>
                    <button className="text-center text-light" style={{width:'15%',background:'none', border:'none'}}><FontAwesomeIcon icon="fa-solid fa-paper-plane" /></button>
                </div>
            </div>
        </div>
    )
}
export const ChatGroupRender = (Objects) => {
    let { id } = useParams();
    //const socket = io("ws://localhost:5000")
    console.log(Objects.find)
    const name = Objects.Object.find(group => group._id === id).name
    return(
        <div className="w-100 h-100 m-0 p-0 text-light">
            <div className="w-100 center m-0 p-0" style={{height:'15%',boxShadow:'0px 5px 5px #000316'}}>
                <div className="w-75 text-start">
                    <FontAwesomeIcon icon="fa-solid fa-user" />
                    &nbsp; <b>{name}</b>
                </div>
            </div>
            <div className="w-100 center m-0 p-0" style={{height:'70%'}}>
                <div className="w-75 text-start">
                    
                </div>
            </div>
            <div className="w-100 center m-0 p-0" style={{height:'15%'}}>
                <div className="text-start" style={{width:'95%'}}>
                    <input className="p-1 fw-bold rounded" style={{width:'85%',background:'none', border:'0.5px solid white'}}/>
                    <button className="text-center text-light" style={{width:'15%',background:'none', border:'none'}}><FontAwesomeIcon icon="fa-solid fa-paper-plane" /></button>
                </div>
            </div>
        </div>
    )
}
